import styles from '../components/passwordbox.module.css'

function Passwordbox() {
  return (
    <div className={styles.passwordbox}>
        <div>
        <p className='passbox'>Password: </p>
        <input type={'password'} name='password1' size="25"></input>
        <br/>

        <p className='passbox'>Confirm Password:</p>
        <input type={'password'} name='password2' size="25"></input>
        </div>
    </div>
  );
}

export default Passwordbox;
